import React from 'react'
import ArtCard from './ArtCard'

function ArtPage(
    { 
        currentUser, 
        artworks, 
        onAcquireArtwork, 
    }
) {

  const uArtwork =
    artworks.map((artwork) => {
        return <ArtCard
                    key={artwork.id} 
                    artwork={artwork} 
                    currentUser={currentUser} 
                    onAcquireArtwork={onAcquireArtwork}
                     />
    })

    return(
        <div style={{margin: '60px'}} className='art-container'>
            {uArtwork}
        </div>
    )
}

export default ArtPage;
